def calculate_kth_number(k: int) -> str:
    numbers = [1.0, 0.01]
    for i in range(2, k + 1):
        next_number = (numbers[i - 1] + numbers[i - 2] / 10) / 10
        numbers.append(next_number)
    kth_number = numbers[k]
    return f'0.{kth_number:.15f}'.rstrip('0').rstrip('.')

